                    <input type=\"password\" required class=\"form-control\" id=\"password\" placeholder=\"Mot de passe\" name=\"_password\"/>

                    <input type=\"hidden\" name=\"_csrf_token\" value=\"{{ csrf_token('authenticate') }}\"/>

                    <button class=\"btn btn-lg btn-primary\" type=\"submit\"><strong>Connexion</strong></button>
                </form>
            </div>

        </div>
    </div>
    </div>
